//TLDP = "    \U7cd6\U5c3f\U75c5\U76f8\U5173\U7684\U808c\U8089\U574f\U6b7b\U662f\U4e00\U79cd\U7f55\U89c1\U75be\U75c5.\U5230\U76ee\U524d\U4e3a\U6b62,\U4ec5\U62a5\U544a\U4e86\U7ea6100\U4f8b\U76f8\U5173\U75c5\U4f8b.\U4e25\U91cd\U7684\U7cd6\U5c3f\U75c5\U6027\U5fae\U8840\U7ba1\U75c5\U53d8\U88ab\U8ba4\U4e3a\U662f\U81ea\U53d1\U6027\U3001\U975e\U574f\U75bd\U6027\U548c\U5c40\U90e8\U808c\U8089\U6897\U6b7b\U7684\U6839\U672c\U673a\U5236.\U4e5f\U6709\U8bc1\U636e\U8868\U660e\U7ea4\U7ef4\U86cb\U767d\U6eb6\U89e3\U548c\U51dd\U56fa\U5f02\U5e38\U3001\U6813\U585e\U73b0\U8c61\U4ee5\U53ca\U8840\U7ba1\U708e\U662f\U5c11\U6570\U75c5\U4f8b\U53d1\U75c5\U7684\U539f\U56e0.\U6b64\U4f8b\U4f34\U6709\U809d\U786c\U5316\U7684\U7cd6\U5c3f\U75c5\U6027\U808c\U574f\U6b7b\U75c5\U4f8b\U503c\U5f97\U5173\U6ce8.\U8fd9\U662f\U9996\U6b21\U5173\U4e8e\U4e24\U79cd\U75c5\U53d8\U76f8\U5173\U7684\U75c5\U4f8b\U62a5\U544a.\U7ee7\U53d1\U4e8e\U4e25\U91cd\U809d\U529f\U80fd\U635f\U4f24\U7684\U51dd\U8840\U65f6\U95f4\U5ef6\U957f\U51e0\U4e4e\U80af\U5b9a\U662f\U5f62\U6210\U8840\U80bf\U7684\U539f\U56e0,\U8840\U80bf\U662f\U7cd6\U5c3f\U75c5\U6027\U808c\U8089\U574f\U6b7b\U60a3\U8005\U5148\U524d\U672a\U53d1\U73b0\U7684\U4e00\U4e2a\U5e76\U53d1\U75c7.\U8fd9\U79cd\U5e76\U53d1\U75c7\U5bfc\U81f4\U4e86\U611f\U67d3\U98ce\U9669\U7684\U5b58\U5728.\U4f4f\U9662\U671f\U95f4\U5728\U60a3\U8005\U5df2\U51fa\U73b0\U4f4e\U70ed\U7684\U60c5\U51b5\U4e0b\U6e05\U7406\U8840\U80bf\U75c5\U7076\U4ee5\U9632\U6b62\U51fa\U73b0\U611f\U67d3.\U5c3d\U7ba1\U8be5\U75c5\U53d8\U548c\U8111\U75c5\U90fd\U5f97\U5230\U4e86\U6539\U5584,\U4f46\U662f\U67d0\U4e9b\U9690\U6027\U6216\U65e0\U75c7\U72b6\U611f\U67d3\U53ef\U80fd\U5bfc\U81f4\U809d\U529f\U80fd\U8fc5\U901f\U6076\U5316,\U4ece\U800c\U5bfc\U81f4\U4e0d\U53ef\U9006\U8f6c\U7684\U4e14\U81f4\U547d\U6027\U809d\U529f\U80fd\U4e0d\U5168.\U7cd6\U5c3f\U75c5\U6027\U808c\U574f\U6b7b\U662f\U4e00\U79cd\U9c9c\U4e3a\U4eba\U77e5\U7684\U7cd6\U5c3f\U75c5\U5e76\U53d1\U75c7,\U9884\U540e\U5dee,\U4e14\U9700\U8981\U6709\U9ad8\U5ea6\U8b66\U60d5\U6027. konggehuiche    \U7cd6\U5c3f\U75c5\U6027\U808c\U574f\U6b7b\U662f\U4e00\U79cd\U5076\U53d1\U6027\U5fae\U8840\U7ba1\U5e76\U53d1\U75c7,\U6613\U4e8e\U53d1\U751f\U4e8e\U4ee3\U8c22\U63a7\U5236\U4e0d\U4f73\U7684\U60a3\U8005,\U5e76\U4e14\U4e0e\U80be\U75c5\Uff0871\Uff05\Uff09\U3001\U89c6\U7f51\U819c\U75c5\U53d8\Uff0856\Uff05\Uff09\U548c\U795e\U7ecf\U75c5\U53d8\Uff0854\Uff05\Uff09\U7b49\U5176\U5b83\U7cd6\U5c3f\U75c5\U5e76\U53d1\U75c7\U76f8\U5173.\U957f\U671f\U7cd6\U5c3f\U75c5\U6027\U8840\U7ba1\U75c5\U53d8\U662f\U7cd6\U5c3f\U75c5\U6027\U808c\U574f\U6b7b\U53d1\U751f\U7684\U5fc5\U8981\U6761\U4ef6.\U4e00\U822c\U8ba4\U4e3a,\U5728\U957f\U671f\U60a3\U6709\U7cd6\U5c3f\U75c5\U7684\U5973\U6027\U60a3\U8005\U4e2d\U5df2\U6709\U62a5\U9053\Uff08\U786e\U8bca\U4e3a\U7cd6\U5c3f\U75c5\U540e15\U5e74\Uff09;\U5927\U591a\U6570\U75c5\U4f8b\U89c1\U4e8e1\U578b\U7cd6\U5c3f\U75c5\U60a3\U8005\Uff0871\Uff05\Uff09.\U57282\U578b\U7cd6\U5c3f\U75c5\U60a3\U8005\U4e2d\U591a\U89c1\U4e8e\U8001\U5e74\U60a3\U8005.konggehuiche    \U867d\U7136\U6ca1\U6709\U660e\U786e\U754c\U5b9a,\U4f46\U662f\U5c0f\U8840\U7ba1\U7684\U52a8\U8109\U7ca5\U6837\U786c\U5316\U6813\U585e\U4e5f\U88ab\U8ba4\U4e3a\U662f\U8be5\U75c5\U7684\U53d1\U75c5\U673a\U5236.\U7531\U4e8e\U5b58\U5728\U591a\U6761\U5e76\U884c\U8840\U7ba1,\U56e0\U6b64\U8be5\U75c5\U6613\U53d1\U4e8e\U5927\U817f\U808c\U8089.\U53e6\U4e00\U79cd\U673a\U5236\U88ab\U8ba4\U4e3a\U662f\U4e0e\U51dd\U8840\U7ea4\U6eb6\U7cfb\U7edf\U76f8\U5173\U7684\U51dd\U8840\U7ea7\U8054\U7cfb\U7edf.konggehuiche    \U60a3\U8005\U53d7\U7d2f\U808c\U8089\U7a81\U53d1\U5267\U70c8\U75bc\U75db\U901a\U5e38\U662f\U8be5\U75c5\U7684\U9996\U53d1\U75c7\U72b6.\U6700\U6613\U53d7\U7d2f\U90e8\U4f4d\U4e3a\U5927\U817f\U808c\U8089;\U901a\U5e38\U4e3a\U5355\U4fa7\U808c\U8089\U53d7\U7d2f.\U5728\U5927\U591a\U6570\U60c5\U51b5\U4e0b,\U5f25\U6f2b\U6027\U3001\U8fc5\U901f\U8fdb\U5c55\U7684\U75bc\U75db\U5411\U8170\U80cc\U90e8\U3001\U819d\U548c\U811a\U653e\U5c04,\U56e0\U6b64\U4e0d\U80fd\U8fdb\U884c\U65e5\U5e38\U6d3b\U52a8.\U4ec5\U67093%\U7684\U60a3\U8005\U51fa\U73b0\U53d1\U70ed.\U9996\U89c1\U4e34\U5e8a\U4f53\U5f81\U4e3a\U5927\U817f\U4f53\U79ef\U7684\U589e\U52a0.\U5f00\U59cb\U65f6\U6539\U53d8\U4e0d\U660e\U663e,\U4f46\U6b64\U540e\U75c5\U53d8\U96c6\U4e2d\U4e8e\U53d7\U7d2f\U808c\U8089.\U53ef\U80fd\U4f1a\U4f34\U6709\U5173\U8282\U79ef\U6db2.\U76ee\U524d40%\U7684\U60a3\U8005\U4f1a\U51fa\U73b0\U660e\U663e\U80bf\U5757.\U7f55\U89c1\U795e\U7ecf\U538b\U8feb,\U5267\U70c8\U75bc\U75db\U4f1a\U5bfc\U81f4\U80a2\U4f53\U6d3b\U52a8\U53d7\U9650.\U80a1\U56db\U5934\U808c\U662f\U6700\U5e38\U53d7\U7d2f\U808c\U8089\Uff0887\Uff05\Uff09,\U80a1\U5916\U4fa7\U808c\U548c\U80a1\U5185\U4fa7\U808c\U53d7\U7d2f\U7387\U5206\U522b24\Uff05\U548c22\Uff05.\U5916\U5c55\U808c\U3001\U9acb\U5c48\U808c\U548c\U4e0a\U80a2\U808c\U8089\U5f88\U5c11\U53d7\U7d2f.\U5728\U7ea610%\U7684\U75c5\U4f8b\U4e2d\U62a5\U544a\U51fa\U73b0\U4e86\U53cc\U4fa7\U53d7\U7d2f\U75c5\U53d8.konggehuiche    \U5b9e\U9a8c\U5ba4\U68c0\U9a8c\U5bf9\U4e8e\U786e\U8bca\U6ca1\U6709\U5e2e\U52a9.\U572852%\U7684\U75c5\U4f8b\U51fa\U73b0\U808c\U9178\U78f7\U9178\U6fc0\U9176\U6c34\U5e73\U6b63\U5e38\U6216\U7565\U6709\U5347\U9ad8;14%\U7684\U75c5\U4f8b\U51fa\U73b0\U767d\U7ec6\U80de\U589e\U591a.\U5927\U591a\U6570\U60c5\U51b5\U4e0b,AST\U3001ALT\U3001LDH\U6c34\U5e73\U548c\U7ea2\U7ec6\U80de\U6c89\U964d\U7387\U662f\U6b63\U5e38\U7684.\U6df1\U9759\U8109\U8840\U6813\U5f62\U6210\U662f\U4e3b\U8981\U7684\U9274\U522b\U8bca\U65ad.\U5176\U6b21\U9700\U8981\U6392\U9664\U7684\U662f\U5b9e\U4f53\U6027\U75c5\U53d8,\U5982\U8840\U80bf\U3001\U5047\U8840\U6813\U6027\U9759\U8109\U708e\U3001\U6025\U6027\U52a8\U8109\U95ed\U585e\U3001\U8113\U80bf\U3001\U8702\U7a9d\U7ec4\U7ec7\U708e\U3001\U7b4b\U819c\U708e\U3001\U6ed1\U56ca\U708e\U548c\U7cd6\U5c3f\U75c5\U8113\U6027\U808c\U708e.\U6709\U65f6\U5f88\U96be\U533a\U5206\U7cd6\U5c3f\U75c5\U6027\U808c\U574f\U6b7b\U548c\U8170\U9ab6\U795e\U7ecf\U6839\U75c5\U53d8\U3001\U7cd6\U5c3f\U75c5\U9aa8\U9ad3\U708e\U3001\U808c\U8089\U6495\U88c2\U3001\U80bf\U7624\U3001\U591a\U53d1\U6027\U808c\U708e\U6216\U589e\U751f\U6027\U808c\U708e.konggehuiche    \U9700\U8981\U6709\U9ad8\U5ea6\U8b66\U60d5\U6027.\U6b64\U75be\U75c5\U5f88\U96be\U901a\U8fc7\U8fdb\U884c\U4f53\U683c\U68c0\U67e5\U786e\U8bca.\U68c0\U67e5\Uff08\U5982X-\U5c04\U7ebf\U6210\U50cf\U3001\U591a\U666e\U52d2\U8d85\U58f0\U3001\U5bf9\U6bd4\U7684CT\U626b\U63cf\U3001\U8840\U7ba1\U9020\U5f71\U548cMRI\Uff09\U901a\U5e38\U80fd\U6392\U9664\U5176\U4ed6\U75c5\U56e0.MRI\U901a\U5e38\U80fd\U786e\U5b9a\U7cd6\U5c3f\U75c5\U6027\U808c\U8089\U574f\U6b7b\U8bca\U65ad.\U78c1\U5171\U632f\U6210\U50cf\U8868\U660e\U6240\U53d7\U7d2f\U808c\U8089\U7684T2\U5e8f\U5217\U4e3a\U9ad8\U5f3a\U5ea6\U4fe1\U53f7.\U5e38\U89c1\U808c\U8089\U5468\U56f4\U6216\U76ae\U4e0b\U7ec4\U7ec7\U6c34\U80bf.\U53ef\U80fd\U662f\U7531\U4e8e\U51fa\U8840\U7ee7\U53d1\U574f\U6b7b,\U6709\U65f6\U53d1\U73b0T1\U5e8f\U5217\U9ad8\U5f3a\U5ea6\U4fe1\U53f7.\U5728\U6781\U5c11\U6570\U60c5\U51b5\U4e0b,\U4e3b\U8981\U662f\U7531\U4e8e\U5bf9\U6807\U51c6\U7597\U6cd5\U7f3a\U4e4f\U5e94\U7b54,\U6545\U9700\U8981\U8fdb\U884c\U6d3b\U7ec4\U7ec7\U68c0\U6765\U786e\U8bca.konggehuiche    \U6d3b\U7ec4\U7ec7\U68c0\U67e5\U662f\U8bca\U65ad\U672c\U75c5\U7684\U91d1\U6807\U51c6.\U7531\U4e8e\U8003\U8651\U5230\U51fa\U73b0\U5e76\U53d1\U75c7\U7684\U98ce\U9669,\U5728\U8fdb\U884c\U6d3b\U68c0\U4e4b\U524d\U5fc5\U987b\U786e\U5b9a\U6709\U660e\U786e\U7684\U9002\U5e94\U75c7.\U57fa\U4e8e\U611f\U67d3\U6216\U5f62\U6210\U8840\U80bf\U7684\U98ce\U9669,\U7ec6\U9488\U7a7f\U523a\U6d3b\U7ec4\U7ec7\U68c0\U67e5\U4f18\U4e8e\U5207\U5f00\U6d3b\U7ec4\U7ec7\U68c0\U67e5.\U901a\U8fc7\U5bf9\U6d3b\U68c0\U7ed3\U679c\U7684\U5ba1\U67e5\U8868\U660e\U5728\U53d8\U6027-\U518d\U751f\U7684\U4e0d\U540c\U9636\U6bb5\U4f1a\U51fa\U73b0\U51fa\U8840\U6027\U574f\U6b7b\U548c\U808c\U7ea4\U7ef4\U6027\U808c\U708e.\U5c0f\U8840\U7ba1\U58c1\U4e3a\U900f\U660e\U72b6\U4e14\U90e8\U5206\U6216\U5168\U90e8\U8840\U7ba1\U8154\U95ed\U585e.\U5728\U4e2d\U7b49\U5927\U5c0f\U7684\U8840\U7ba1\U4e2d,\U53ef\U89c2\U5bdf\U5230\U52a8\U8109\U7ca5\U6837\U786c\U5316\U75c5\U7076.\U5e94\U8fdb\U884c\U7ec6\U83cc\U3001\U771f\U83cc\U548c\U6297\U9178\U6746\U83cc\U7684\U57f9\U517b,\U4f46\U662f\U9664\U975e\U51fa\U73b0\U4e86\U808c\U8089\U574f\U6b7b,\U5426\U5219\U57f9\U517b\U7ed3\U679c\U5e94\U4e3a\U9634\U6027. konggehuiche    \U75bc\U75db\U548c\U708e\U75c7\U7684\U63a7\U5236\U662f\U4e3b\U8981\U6cbb\U7597\U63aa\U65bd.\U7edd\U5bf9\U5367\U5e8a\U4f11\U606f\U3001\U975e\U753e\U4f53\U6297\U708e\U836f\U7269\U6216\U9ebb\U9189\U836f\U7684\U4f7f\U7528\U5177\U6709\U7f13\U6162\U800c\U9010\U6b65\U7684\U6539\U5584\U75c7\U72b6.\U8054\U5408\U5e94\U7528\U6297\U8840\U5c0f\U677f\U548c\U6297\U53d1\U708e\U836f\U7269\U53ef\U51cf\U5c11\U6574\U4f53\U5eb7\U590d\U65f6\U95f4\Uff08\U4ece8\U5468\U7f29\U77ed\U4e3a5\U5468\Uff09.\U867d\U7136\U6ca1\U6709\U4efb\U4f55\U8bc1\U636e\U8868\U660e\U6b64\U65b9\U6cd5\U5c06\U9884\U9632\U53d1\U75c5\U7387\U6216\U6b7b\U4ea1\U7387,\U4f46\U6211\U4eec\U4ecd\U63a8\U8350\U7cd6\U5c3f\U75c5\U60a3\U8005\U8fdb\U884c\U66f4\U597d\U7684\U4ee3\U8c22\U63a7\U5236.\U5e94\U8003\U8651\U9ad8\U51dd\U72b6\U6001,\U5982\U679c\U786e\U8bca,\U90a3\U4e48\U5e94\U5f00\U59cb\U6297\U51dd.\U5efa\U8bae\U91c7\U7528\U624b\U672f\U7597\U6cd5\U6cbb\U7597\U52a8\U8109\U59a5\U534f\U60c5\U51b5\U4e0b\U7684\U51cf\U538b.konggehuiche    \U5728\U5927\U591a\U6570\U60c5\U51b5\U4e0b,\U77ed\U671f\U9884\U540e\U826f\U597d.\U75bc\U75db\U548c\U708e\U75c7\U81f3\U5c11\U9700\U89818\U5468\U624d\U80fd\U6d88\U5931.\U4e3b\U8981\U7684\U6f5c\U5728\U95ee\U9898\U662f\U5bfc\U81f4\U77ed\U671f\U5185\U51fa\U73b0\U5371\U53ca\U751f\U547d\U5e76\U53d1\U751f\U7684\U665a\U671f\U5168\U8eab\U6027\U5fae\U8840\U7ba1\U75c5\U53d8.\U9ad8\U8fbe50\Uff05\U7684\U75c5\U4f8b\U53ef\U80fd\U51fa\U73b0\U590d\U53d1,\U5176\U4e2d\U5927\U90e8\U5206\U53d1\U751f\U5728\U5148\U524d\U53d7\U7d2f\U7684\U808c\U8089\U90e8\U4f4d.\U51e0\U4e4e\U4e00\U534a\U7684\U590d\U53d1\U4e8b\U4ef6\U57282\U4e2a\U6708\U5185\U51fa\U73b0.";
