//    TLDP = "\U60ca\U6050\U969c\U788d\Uff1akonggehuiche\U75c7\U72b6\Uff1akonggehuiche\U60ca\U6050\U969c\U788d\U6307\U53cd\U590d\U7684\U3001\U6709\U65f6\U4e3a\U4e0d\U53ef\U9884\U6599\U7684\U7126\U8651\U6216\U60ca\U6050\U53d1\U4f5c.\U53d1\U4f5c\U7a81\U5982\U5176\U6765,\U8ba9\U4eba\U6781\U7aef\U75db\U82e6,\U6301\U7eed\U51e0\U5206\U949f\U6216\U66f4\U4e45\U4e00\U4e9b.\U5728\U60ca\U6050\U969c\U788d\U4e2d,\U53d1\U4f5c\U4e0d\U9650\U4e8e\U53d1\U751f\U5728\U7279\U5b9a\U7684\U53ef\U9884\U6599\U7684\U60c5\U5883\U4e2d.\U60ca\U6050\U53d1\U4f5c\U540e\U4f1a\U6301\U7eed\U62c5\U5fc3\U518d\U6b21\U53d1\U4f5c.\U5305\U62ec3\U90e8\U5206\U75c7\U72b6:konggehuiche1\U3001\U60ca\U6050\U53d1\U4f5c \U5178\U578b\U7684\U8868\U73b0\U662f,\U60a3\U8005\U6b63\U5728\U8fdb\U884c\U65e5\U5e38\U6d3b\U52a8,\U5982\U770b\U4e66\U3001\U8fdb\U98df\U3001\U6563\U6b65\U3001\U5f00\U4f1a\U6216\U64cd\U6301\U5bb6\U52a1\U65f6,\U7a81\U7136\U611f\U5230\U6c14\U77ed,\U5934\U6655\U6216\U8f7b\U5ea6\U5934\U75db,\U6655\U53a5,\U9707\U98a4\U6216\U98a4\U52a8,\U4e0d\U771f\U5b9e\U611f,\U53e3\U5e72,\U96be\U4ee5\U96c6\U4e2d\U601d\U60f3\U6216\U8bb2\U8bdd,\U89c6\U7269\U6a21\U7cca,\U80f8\U95f7\U3001\U80f8\U75db\U80f8\U90e8\U538b\U7d27\U6216\U75bc\U75db\U611f\U6216\U547c\U5438\U56f0\U96be,\U5589\U5934\U5835\U585e,\U597d\U50cf\U900f\U4e0d\U8fc7\U6c14\U6765,\U5373\U5c06\U7a92\U606f.\U5fc3\U60b8,\U5fc3\U810f\U5267\U8df3,\U597d\U50cf\U5fc3\U810f\U8981\U4ece\U53e3\U8154\U91cc\U8df3\U51fa\U6765;\U624b\U9ebb,\U8db3\U9ebb,\U7a92\U606f\U611f,\U51fa\U6c57,\U6f6e\U70ed\U6216\U5bd2\U6218,\U8feb\U5207\U60f3\U9003\U8131,\U6076\U5fc3,\U808c\U8089\U7d27\U5f20,\U6015\U6b7b\U53bb\U3001\U5931\U53bb\U63a7\U5236\U6216\U53d1\U75af.\U540c\U65f6\U51fa\U73b0\U5f3a\U70c8\U7684\U6050\U60e7\U611f,\U597d\U50cf\U5373\U5c06\U6b7b\U53bb,\U6216\U5373\U5c06\U5931\U53bb\U7406\U667a.\U8fd9\U79cd\U7d27\U5f20\U5fc3\U60c5\U4f7f\U60a3\U8005\U96be\U4ee5\U5fcd\U53d7.\U56e0\U800c\U60ca\U53eb\U3001\U547c\U6551.\U6709\U7684\U51fa\U73b0\U8fc7\U5ea6\U6362\U6c14(hyperventilation)\U3001\U5934\U6655\U3001\U975e\U771f\U5b9e\U611f\U3001\U591a\U6c57\U3001\U9762\U90e8\U6f6e\U7ea2\U6216\U82cd\U767d,\U6b65\U6001\U4e0d\U7a33\U3001\U9707\U98a4\U3001\U624b\U811a\U9ebb\U6728\U3001\U80c3\U80a0\U9053\U4e0d\U9002\U7b49\U81ea\U4e3b\U795e\U7ecf\U8fc7\U5ea6\U5174\U594b\U75c7\U72b6,\U4ee5\U53ca\U8fd0\U52a8\U6027\U4e0d\U5b89.\U5728\U60ca\U6050\U53d1\U4f5c\U4e2d\U60a3\U8005\U4e00\U822c\U7aed\U529b\U60f3\U9003\U907f\U67d0\U79cd\U7279\U6b8a\U529f\U80fd\U7684\U60c5\U5883\U4ee5\U671f\U671b\U60ca\U6050\U505c\U6b62,\U6216\U8005\U5bfb\U6c42\U5e2e\U52a9\U4ee5\U9632\U5d29\U6e83\U3001\U5fc3\U810f\U75c5\U53d1\U4f5c\U6216\U53d1\U75af.\U6b64\U79cd\U53d1\U4f5c\U7a81\U7136,\U53d1\U4f5c\U65f6\U610f\U8bc6\U6e05\U6670,\U5386\U65f6\U77ed\U6682,\U4e00\U822c5\Uff5e20min(10min\U5185\U8fbe\U5230\U9ad8\U5cf0),\U5f88\U5c11\U8d85\U8fc71h,\U5373\U53ef\U81ea\U884c\U7f13\U89e3;\U6216\U4ee5\U54c8\U6b20\U3001\U6392\U5c3f\U3001\U5165\U7761\U800c\U7ed3\U675f\U53d1\U4f5c.\U53d1\U4f5c\U95f4\U671f\U7cbe\U795e\U72b6\U6001\U6b63\U5e38.\U53d1\U4f5c\U4e4b\U540e,\U60a3\U8005\U81ea\U89c9\U4e00\U5207\U5982\U5e38,\U80fd\U56de\U5fc6\U53d1\U4f5c\U7684\U7ecf\U8fc7.\U4f46\U4e0d\U4e45\U53c8\U53ef\U7a81\U7136\U518d\U53d1.\U75c5\U4eba\U53ef\U4ee5\U9891\U7e41\U53d1\U4f5c,1\U4e2a\U6708\U8fbe3\U6b21\U4ee5\U4e0a.konggehuiche2\U3001\U9884\U671f\U7126\U8651 \U5927\U591a\U6570\U60a3\U8005\U5728\U53cd\U590d\U51fa\U73b0\U60ca\U6050\U53d1\U4f5c\U4e4b\U540e\U7684\U95f4\U6b47\U671f,\U5e38\U62c5\U5fc3\U518d\U6b21\U53d1\U75c5,\U56e0\U800c\U7d27\U5f20\U4e0d\U5b89,\U4e5f\U53ef\U51fa\U73b0\U4e00\U4e9b\U81ea\U4e3b\U795e\U7ecf\U6d3b\U52a8\U4ea2\U8fdb\U7684\U75c7\U72b6,\U79f0\U4e3a\U9884\U671f\U6027\U7126\U8651,\U53ef\U6301\U7eed1\U4e2a\U6708\U4ee5\U4e0a.\U5e94\U6ce8\U610f\U4e0e\U5e7f\U6cdb\U6027\U7126\U8651\U9274\U522b.konggehuiche3\U3001\U6c42\U52a9\U548c\U56de\U907f\U884c\U4e3a \U60ca\U6050\U53d1\U4f5c\U65f6,\U7531\U4e8e\U5f3a\U70c8\U7684\U6050\U60e7\U611f,\U60a3\U8005\U96be\U4ee5\U5fcd\U53d7,\U5e38\U7acb\U5373\U8981\U6c42\U7ed9\U4e88\U7d27\U6025\U5e2e\U52a9.\U5728\U53d1\U4f5c\U7684\U95f4\U6b47\U671f,60%\U7684\U60a3\U8005\U7531\U4e8e\U62c5\U5fc3\U53d1\U75c5\U65f6\U5f97\U4e0d\U5230\U5e2e\U52a9,\U56e0\U800c\U4e3b\U52a8\U56de\U907f\U4e00\U4e9b\U6d3b\U52a8,\U5982\U4e0d\U613f\U5355\U72ec\U51fa\U95e8,\U4e0d\U613f\U5230\U4eba\U591a\U7684\U70ed\U95f9\U573a\U6240,\U4e0d\U613f\U4e58\U8f66\U65c5\U884c\U7b49,\U6216\U51fa\U95e8\U65f6\U8981\U4ed6\U4eba\U966a\U4f34;\U5373\U7ee7\U53d1\U5e7f\U573a\U6050\U60e7\U75c7.\U60ca\U6050\U53d1\U4f5c\U6709\U65f6(\U5e76\U4e0d\U603b\U662f)\U4f1a\U5bfc\U81f4\U5bf9\U67d0\U4e9b\U60c5\U5883\U7684\U5e7f\U573a\U6050\U60e7\U6837\U56de\U907f,\U5728\U8fd9\U79cd\U60c5\U5883\U4e2d\U611f\U5230\U8eb2\U907f\U5f88\U56f0\U96be\U6216\U4ee4\U4eba\U96be\U582a,\U6216\U8005\U611f\U5230\U4e0d\U80fd\U7acb\U523b\U5f97\U5230\U522b\U4eba\U7684\U5e2e\U52a9.\U56e0\U6b64,\U53ef\U5206\U4e3a\U60ca\U6050\U969c\U788d\U4f34\U5e7f\U573a\U6050\U60e7\U75c7\U548c\U60ca\U6050\U969c\U788d\U4e0d\U4f34\U5e7f\U573a\U6050\U60e7\U75c7\U4e24\U79cd\U7c7b\U578b.\U5076\U5c14\U7684\U60ca\U6050\U53d1\U4f5c(\U5373\U60ca\U6050\U53d1\U4f5c\U7684\U9891\U5ea6\U4e0d\U8db3\U4ee5\U4f5c\U51fa\U60ca\U6050\U969c\U788d\U7684\U8bca\U65ad)\U4e5f\U53ef\U4ee5\U51fa\U73b0\U5728\U5176\U4ed6\U7684\U7cbe\U795e\U969c\U788d\U4e2d,\U7279\U522b\U662f\U5728\U5176\U4ed6\U7126\U8651\U969c\U788d\U4e2d.konggehuiche\U672c\U75c5\U5e38\U65e0\U660e\U663e\U8bf1\U56e0\U7a81\U7136\U53d1\U75c5,\U6709\U591a\U79cd\U81ea\U4e3b\U795e\U7ecf\U75c7\U72b6,\U5c24\U4ee5\U5fc3\U60b8\U3001\U6c14\U7d27\U3001\U5934\U6655\U3001\U51fa\U6c57\U7b49\U6700\U7a81\U51fa;\U5728\U77ed\U65f6\U95f4\U5185\U75c7\U72b6\U6025\U5267\U53d1\U5c55\U8fbe\U5230\U9ad8\U5cf0,\U4f34\U6709\U5f3a\U70c8\U6050\U60e7;\U6301\U7eed\U65f6\U95f4\U5f88\U77ed\U4fbf\U81ea\U884c\U7f13\U89e3.\U95f4\U6b47\U671f\U9664\U6709\U9884\U671f\U7126\U8651,\U62c5\U5fc3\U518d\U6b21\U53d1\U75c5\U5916,\U53ef\U65e0\U4efb\U4f55\U4e0d\U9002\U75c7\U72b6.\U5e38\U53cd\U590d\U53d1\U4f5c.\U95f4\U6b47\U671f\U53ef\U957f\U53ef\U77ed.\U53d1\U4f5c\U9891\U7e41,\U52a0\U4e0a\U9884\U671f\U7126\U8651,\U6613\U8bef\U8bca\U4e3a\U5e7f\U6cdb\U7126\U8651\U969c\U788d.\U4e0d\U5c11\U75c5\U4f8b\U7ee7\U53d1\U5e7f\U573a\U6050\U60e7\U75c7,DSM-\U2163\U5c06\U672c\U75c5\U533a\U5206\U4e3a:\U60ca\U6050\U969c\U788d\U4f34\U6709\U5e7f\U573a\U6050\U6016\U548c\U60ca\U6050\U969c\U788d\U4e0d\U4f34\U5e7f\U573a\U6050\U6016\U4e24\U79cd\U4e9a\U578b.\U5408\U5e76\U91cd\U578b\U6291\U90c1\U75c7\U8005\U5e94\U5206\U522b\U7ed9\U4e88\U8bca\U65ad.konggehuiche\U6839\U636eICD-10\U7684\U8bca\U65ad\U6807\U51c6,\U60ca\U6050\U53d1\U4f5c\U8bca\U65ad\U4f9d\U636e\U4e3a1\U4e2a\U6708\U5185\U81f3\U5c11\U67093\U6b21\U53d1\U4f5c,\U6bcf\U6b21\U4e0d\U8d85\U8fc72h.\U53d1\U4f5c\U65f6\U660e\U663e\U5f71\U54cd\U65e5\U5e38\U6d3b\U52a8.\U4e24\U6b21\U53d1\U4f5c\U7684\U95f4\U6b47\U671f,\U9664\U5bb3\U6015\U518d\U53d1\U4f5c\U5916,\U6ca1\U6709\U660e\U663e\U75c7\U72b6.\U5e76\U6709\U4ee5\U4e0b\U7279\U70b9:konggehuiche1\U3001\U53d1\U4f5c\U7684\U60c5\U5883\U4e2d\U6ca1\U6709\U771f\U6b63\U7684\U5371\U9669.konggehuiche2\U3001\U5e76\U4e0d\U5c40\U9650\U5728\U5df2\U77e5\U6216\U53ef\U9884\U6599\U7684\U60c5\U5883\U4e2d(\U53c2\U89c1\U7279\U5b9a\U7684\U6050\U60e7\U75c7\U6216\U793e\U4ea4\U6050\U60e7\U75c7).konggehuiche3\U3001\U5728\U60ca\U6050\U53d1\U4f5c\U95f4\U6b47\U671f\U51e0\U4e4e\U65e0\U7126\U8651\U75c7\U72b6(\U5c3d\U7ba1\U5e38\U4f1a\U62c5\U5fc3\U4e0b\U6b21\U60ca\U6050\U53d1\U4f5c).konggehuiche4\U3001\U4e0d\U662f\U7531\U751f\U7406\U75b2\U52b3\U3001\U8eaf\U4f53\U75be\U75c5(\U5982\U7532\U72b6\U817a\U529f\U80fd\U4ea2\U8fdb)\U6216\U7269\U8d28\U6ee5\U7528\U7684\U7ed3\U679c.konggehuiche\U66f4\U8be6\U7ec6\U7684\U8d44\U6599\U8bf7\U53c2\U8003ICD-10\U3001CCMD-\U2162\U6216DSM-\U2163.konggehuiche";
